import React from 'react'

function Home() {
  return (
    <div className='h-screen flex-col flex bg-indigo-100 w-full items-center justify-center px-6'>
      <h1 className='sm1:text-xl lg:text-5xl font-bold text-gray-800'>Welcome To Borrow and Return Device Website</h1>
      <h2 className='text-yellow-600 font-bold py-4 lg:text-4xl sm1:text-xl'>KDR Transport</h2>
      <p className=''>เว็บไซต์นี้จัดทำขึ้นโดยฝ่ายไอที เพื่อจัดเก็บการยืม - คืน อุปกรณ์ของพนักงานภายในบริษัท</p>
    </div>
  )
}

export default Home
